values:
Did some housework this morning, cleaned the office again, man Jaylynn loves to draw and make pictures, but she has discovered scissors and leaves paper EVERYWHERE!&nbsp; Even when I clean it up at night, there she is again in the morning, lol.&nbsp; I cleaned the kitchen.&nbsp; Our electric bill has been astronomical, and we can't figure it out, so I have been only doing the dishwasher every other day.&nbsp; The air has been off all month, so maybe that will help.&nbsp; We should be getting our next bill soon.&nbsp; 

Yesterday was my mom's birthday.&nbsp; I called her and wished her well and everything, but it sucks that I can't sit and have a piece of cake with her or anything.&nbsp; Or take her salsa dancing or something.&nbsp; We sent her a package of cards, one I made, and a few Jaylynn made.&nbsp; I also sent her a framed picture of the kids for her desk, that I decorated the frame with some grandma stickers, lol.&nbsp; It was cute, but I wish I could have sent more, we are definately on the broke side lately.&nbsp; I'm just glad are bills are starting to come back together, and the car's are running.&nbsp; Got two things to fix on the truck, a part on the rear tire, and the body damage, and it is good.&nbsp; But at least it's drivable now.&nbsp; 

I have been really thinking I need to go back to work full time so we can catch up faster and start doing things we want and need.&nbsp; We have our anniversary coming up (thank God we are making it, lol), Halloween, Thanksgiving, which is going to be here at our house and we have yet to buy a dining table, we only have our four seater and 2 bar stools.&nbsp; We also have Christmas coming of course and we are going up north for that if we can save enough, and we have been planning Disney in February for Jaylynn's 5th birthday since she was born!&nbsp; It sucks, because day care is super expensive and that's the reason I quit working to begin with, but maybe we can find a nice in home day care that is not that expensive, but still interacts and teaches the kids.&nbsp; Jaylynn would just go to after school care at her school, so I just need to find Jorden a place.&nbsp; It would be nice if he could go to where Jay is, but damn, they are super expensive!!&nbsp; I am glad Jaylynn's pre-k is only $100 a month for food.&nbsp; They were talking $150 a week for Jorden for part time!!&nbsp; WTF!&nbsp; I really hate day care, lol.&nbsp; But we do get that tax break for the amount we paid during taxes, so that's always a plus.&nbsp; 

Ok, I'm rambling.&nbsp; Bout to go put the kids to nap.&nbsp; 


Who watched the debate last night?&nbsp; I hope everyone did.&nbsp; McCain was really strong in international affairs.&nbsp; That is a big deal to me with the troops.&nbsp; But I am still an Obama fan.&nbsp; Currently, I have not made my final decision, but I the debates always help.&nbsp; All I have to say is Tuesday they both need to step it up.&nbsp;

with both kids in hand, we will see how long they last at the day care center.&nbsp; This is Jaylynn's first time, but Jorden has only lasted half an hour before.&nbsp; I hope with big sister there, he won't cry that much.&nbsp; 

I said if they don't cry, then we can all go to the park afterwards.&nbsp; Which I may just take them anyway cause they been wanting to go.&nbsp; Because it was so hot when Jay got home from school yesterday, I filled their little pool and had them do that instead of the park.&nbsp; So we'll see.&nbsp; 

Then I am coming home to clean, clean, clean, and do laundry.

But mine was great! Some pictures later today. 


Did you vote today? http://www.myspace.com/universityofphoenix
